- input: TEXT,F5A,,"The cover page of this filing marks Type of Report boxes for both
    a 48 hour report and a Pre-Primary Report.  Please understand that today's filing
    is intended to fulfill the obligation to electronically file independent expenditures
    made on 10/11/04 within 48 hours.  Under previous advice from the Commission's
    Electronic Filing Division, the Fund has been using both the 48 hour notation
    along with the selection of a report type and its corresponding coverage dates
    in order to facilitate successful electronic filing with the FEC until electronic
    specifications are changed to more fully accommodate the upload of 48 hour reports
    by independent expenditure filers."
