  input: TEXT,F5A,,"Also note that the use of this alternate report type designation
    is now causing a problem in filing the October Quarterly Pre-General Reports,
    due 10/15/04 and 10/21/04 respectively; therefore, this report has been prepared
    as an amended report to disclose all activity between 8/30/04 and 10/13/04.  We
    hope that this filing can serve to satisfy the requirement to file all activity
    through the Pre-General Reporting period closing October 13, 2004. As the Commission
    and its vendor work to enable Form 5 filers to be able to properly upload 48 hour
    reports, our vendor will assist in any way it can to accommodate non-PAC independent
    expenditure filers."
